Notify(
    "Vui lòng đợi",
    NotificationType.Information
);
UpdateContext({ReturnTime7: '[CanvasApp]ReturntimeUTC+7'.Run().returntime7});
With(
    {
        LK_CNKH: LookUp(
            'Cập nhật khách háng',
            Status = 'Status (Cập nhật khách háng)'.Active && 'Mã KH' = lookup_KH.'Mã khách hàng' && 'Thời gian check in' >= DateValue(ReturnTime7) && 'Thời gian check in' < DateAdd(
                DateValue(ReturnTime7),
                1
            ) && 'Mail sale old' = mail_sale
        ),
        SaleApp_Pivot: LookUp(
            SalesApp_Pivot,
            'Mã KH' = lookup_KH.'Mã khách hàng' && 'Incharge mail - Task' = mail_sale
        )
    },
    With(
        {
            ThoiGianHienTai: DateTimeValue(ReturnTime7),
            SoPhutChamSoc: DateDiff(
                LK_CNKH.'Thời gian check in',
                DateTimeValue(ReturnTime7),
                TimeUnit.Minutes
            ),
            TTGK: Dp_Choices_TTGK.Selected.Value,
            IsKhongGap: Dp_Choices_TTGK.Selected.Value = 'Trạng thái gặp khách (Cập nhật khách háng)'.'Không gặp được'
        },
        If(
            !IsBlank(Location.Latitude) And !IsBlank(Location.Longitude),
            If(
                SoPhutChamSoc >= 15 || IsBlank(LK_CNKH) || IsKhongGap,
                If(
                    IsBlank(LK_CNKH),
            // Check-in mới
                    UpdateContext(
                        {
                            CNKH_DangXuLy: Patch(
                                'Cập nhật khách háng',
                                Defaults('Cập nhật khách háng'),
                                {
                                    'Khách hàng': lookup_KH,
                                    Photo: UploadedImage2_11.Image,
                                    'Check in': toa_do,
                                    Latitude: Location.Latitude,
                                    Longitude: Location.Longitude,
                                    'Thời gian check in': ThoiGianHienTai,
                                    'Mail sale old': mail_sale,
                                    'Trạng thái gặp khách': TTGK
                                }
                            )
                        }
                    );
                    If(
                        IsKhongGap,
                        Patch(
                            SalesApp_Pivot,
                            SaleApp_Pivot,
                            {Check: "Done"}
                        );
                        Reset(Dp_Choices_TTGK);
                        UpdateContext({xuly_task_detail: !xuly_task_detail})
                    );
                    If(
                        IsBlank(lookup_KH.'Tọa độ xác minh'),
                        Patch(
                            Customers,
                            lookup_KH,
                            {
                                'Tọa độ xác minh': toa_do,
                                'Hình ảnh xác minh tọa độ': UploadedImage2_11.Image
                            }
                        )
                    );
                    Notify(
                        "Check in thành công!",
                        NotificationType.Success,
                        5000
                    );
                    UpdateContext({Json_VerifyCHKD: lookup_KH.'Verify CHKD'});
                    UpdateContext({Show_Container_VerifyCHKD: true});
                    ClearCollect(
                        VerifyCHKD_ChuaMua,
                        FirstN(
                            Shuffle(
                                AddColumns(
                                    Table(ParseJSON(lookup_KH.'CHKD chưa mua')),
                                    'Nhóm SP',
                                    Text(Value.NSP),
                                    'Mã nhóm SP',
                                    Text(Value.crdfd_manhomsp)
                                )
                            ),
                            10
                        )
                    );
                    ,
            // Check-out
                    Patch(
                        'Cập nhật khách háng',
                        LK_CNKH,
                        {
                            'Photo check out': UploadedImage2_11.Image,
                            'Check out': toa_do,
                            'Thời gian check out': ThoiGianHienTai,
                            'Tình hình thị trường': Input_tinhhinhthitruong.Text,
                            'Tình hình khách hàng': Input_tinhhinhkhachhang.Text,
                            'Phản hồi của khách hàng': Input_phanhoicuakhachhang.Text,
                            'Trạng thái gặp khách': TTGK
                        }
                    );
                    Patch(
                        SalesApp_Pivot,
                        SaleApp_Pivot,
                        {Check: "Done"}
                    );
                    UpdateContext({CNKH_DangXuLy: {}});
                    Notify(
                        "Check out thành công!",
                        NotificationType.Success,
                        5000
                    );
                    Reset(Dp_Choices_TTGK);
                    Reset(Input_tinhhinhthitruong);
                    Reset(Input_tinhhinhkhachhang);
                    Reset(Input_phanhoicuakhachhang);
                    UpdateContext({xuly_task_detail: !xuly_task_detail})
                ),
                Notify(
                    "Chăm sóc tối thiểu 15 phút, bạn đã chăm sóc " & SoPhutChamSoc & " phút",
                    NotificationType.Warning,
                    5000
                )
            ),
            Notify(
                "Vui lòng thoát app và bật tọa độ",
                NotificationType.Warning,
                3000
            )
        )
    )
);
Reset(AddMedia_checkinout);

If(
    IsBlank(DataCard_tenkhachhang),
    Notify("Chưa điền thông tin tên khách hàng",NotificationType.Error,3000),
    If(
        IsBlank(DataCard_dienthoai),
        Notify("Chưa điền Số điện thoại",NotificationType.Error,3000),
        If(
            IsBlank(DataCard_NhanVienConno),
